import  React  from "react";
import {deleteUserPost} from "../api/Api"






const handleDelete = async (postID, token, fetchUser) => {
    try {
         await deleteUserPost(postID, token)
         fetchUser()
        }catch(error) {
        console.error(error)
    }
}




const UserPost = ({token, userData, fetchUser}) => {
    //  console.log("User Data", userData.posts)


    if(userData.posts) {
        console.log("User Posts before filter", userData.posts)



        let existingPosts = userData.posts.filter(post => post.active)
        console.log("User Post Here Lol", existingPosts)
    } else {
        console.log("Nothing Here")
    }

return (



    existingPosts.map(post =>
    post.active? 
    <div className="post-container" key={post._id}>
    <div>{post.author.username}</div>
    <h2>{post.title}: {post.price}</h2>
    <h3>{post.description}</h3>
    <button className="delete-post" onClick={() => handleDelete(post._id, token, fetchUser)}>Delete</button>
    </div>:
    null
        )


)}





export default UserPost
